{"MINUTE_COL":{"type":"keyword","script":{"source":"// Convertir el string a un objeto ZonedDateTime en UTC
ZonedDateTime inputDateTime = ZonedDateTime.parse(doc['MINUTE.keyword'].value + ':00', DateTimeFormatter.ofPattern('yyyy-MM-dd HH:mm:ss').withZone(ZoneId.of('UTC')));

// Convertir el timestamp de UTC a la zona horaria de Bogotá
ZonedDateTime bogotaDateTime = inputDateTime.withZoneSameInstant(ZoneId.of('America/Bogota'));

// Retornar la fecha ajustada a Bogotá
emit(bogotaDateTime.format(DateTimeFormatter.ofPattern('yyyy-MM-dd HH:mm')));

"}}}
